import React from 'react';
import {Link} from 'react-router-dom';
import FotoPerfil from './Images/usuario.png';
import Carrito from './Images/carrito.png';


export default function articlePerfilDeUsuario(){
  return(
    <>
    <div class = "perfilDeUsuario" >

    <img class="fotoPerfil" src= {FotoPerfil} alt="A FotoPerfil"/>
    <h25>Nombre de usuario:</h25>
    <h26>Correo:</h26>
    <h27>Edad:</h27>

    <button class="botonHistorialCompras">Historial de Compras</button>
    <Link to= "/ingresoPreferencias"><button class="botonIngresoPreferencias" >Ingresar preferencias</button></Link>

    <img class="carritoPerfil" src= {Carrito} alt="A carritoPerfil"/>

    <div class = "infoDeinteres">
    <h28>Mis generos Favoritos:</h28>
    <h29>Ultimos comprados:</h29>
    </div>

    </div>

    <div class = "notificacionPerfil" >

      <h23>¿Aun no ingresas las caracteristicas de tu equipo?</h23>
      <Link to= "/ingresoEspecificaciones"><button class = "ingresarLascaracteristicasDesdeNotificacion">Ingresar</button></Link>
      <div />
      <h24>¿Deseas cambiar las caracteristicas de tu equipo?</h24>
      <Link to= "/ingresoEspecificaciones"><button class = "cambiarLascaracteristicasDesdeNotificacion">Cambiar</button></Link>
    </div>
    </>

);
}
